// src/components/Navbar/Navbar.jsx
import React from 'react';
import './Navbar.css';

const Navbar = ({ onSportSelect }) => {
  return (
    <nav className="navbar">
      <h1 className="navbar-heading">Sports Connect</h1>
      <div className="navbar-buttons">
        <button onClick={() => onSportSelect('cricket')}>Cricket</button>
        <button onClick={() => onSportSelect('basketball')}>Basketball</button>
        <button onClick={() => onSportSelect('football')}>Football</button>
        <button onClick={() => onSportSelect('volleyball')}>Volleyball</button>
      </div>
    </nav>
  );
};

export default Navbar;
